import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './app/routes/App.tsx';
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className='indexDiv'>
      <App />
    </div>
  </React.StrictMode>
);
